import React from "react";
import NavBar from "./navbar";
const ProjectDetails = ({ navHidden, hideNav, switchNavState }) => {
  return (
    <div className="form">
      <NavBar
        color="black"
        active="sign-in"
        navHidden={navHidden}
        hideNav={hideNav}
        switchNavState={switchNavState}
      />
      <div className="bg-red-500">
        <div className="tex-lg text-gray-700">Input Project Details</div>
      </div>
    </div>
  );
};

export default ProjectDetails;
